CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_inserta_usuarios_aleatorios`(v_cantidad INT)
BEGIN
    DECLARE i INT DEFAULT 1;
    DECLARE v_genero ENUM('Femenino', 'Masculino', 'No_Binario');
    DECLARE v_nombre VARCHAR(45);
    DECLARE v_peso FLOAT;
    DECLARE v_talla FLOAT;
    DECLARE v_fecha_nacimiento DATE;
    DECLARE v_estatus ENUM('Activo', 'Inactivo');
    DECLARE v_fecha_registro DATETIME;
    
    WHILE i <= v_cantidad DO
        SET v_genero = ELT(FLOOR(RAND() * 3) + 1, 'Femenino', 'Masculino', 'No_Binario');
        SET v_nombre = CONCAT('Usuario', i);
        SET v_peso = ROUND(RAND() * 100 + 50, 2);
        SET v_talla = ROUND(RAND() * 50 + 150, 2);
        SET v_fecha_nacimiento = DATE_SUB(CURRENT_DATE(), INTERVAL ROUND(RAND() * 50 + 20) YEAR);
        SET v_estatus = ELT(FLOOR(RAND() * 2) + 1, 'Activo', 'Inactivo');
        SET v_fecha_registro = NOW();
        
        INSERT INTO usuario (Nombre, Genero, Peso, Talla, Fecha_Nacimiento, Estatus, Fecha_Registro)
        VALUES (v_nombre, v_genero, v_peso, v_talla, v_fecha_nacimiento, v_estatus, v_fecha_registro);
        
        SET i = i + 1;
    END WHILE;
END ;;
