        SET v_peso = ROUND(RAND() * 100 + 50, 2);
        SET v_talla = ROUND(RAND() * 50 + 150, 2);
        
        -- Generar fecha de nacimiento evitando que cumplan años en el mismo día y mes
        SET v_day = FLOOR(RAND() * 28) + 1; -- Día aleatorio entre 1 y 28
        SET v_month = FLOOR(RAND() * 12) + 1; -- Mes aleatorio entre 1 y 12
        SET v_year = FLOOR(RAND() * 50) + 1970; -- Año aleatorio entre 1970 y 2019
        SET v_fecha_nacimiento = CONCAT(v_year, '-', v_month, '-', v_day);
        
        SET v_estatus = ELT(FLOOR(RAND() * 2) + 1, 'Activo', 'Inactivo');
        SET v_fecha_registro = NOW();
        
        INSERT INTO usuario (Nombre, Genero, Peso, Talla, Fecha_Nacimiento, Estatus, Fecha_Registro)
        VALUES (v_nombre, v_genero, v_peso, v_talla, v_fecha_nacimiento, v_estatus, v_fecha_registro);
        
